 `,"Favorite Part":"///."},:{Rating:"",Author:"",Month:7,Language:"",Genre:["Mystery"],Quotes:[""],Thoughts:"/spoiler X? ","Favorite Part":""},"Between the World and Me":{Rating:"",Author:"Ta-Nehisi Coates",Month:7,Language:"ENG",Genre:["Non-Fiction"],Quotes:["The new people were something else before they were white --- Catholic, Corscian, Welsh, Mennonite, Jewish --- and if all our national hopes have any fulfillment, then they will have to be something else again. (007) | Coatess discussion of the birth of race brought me back to APUSH, where I learned that any immigrants, even Jewish and German who look white, were discriminated against. This diverts the idea of racisms focus on the struggle between black and white for me.","We did not choose our fences. They were imposed on us by Virginia planters obsessed with enslaving as many Americans as possible. They are the ones who came up with a one-drop rule that separated the white from the black, even if it meant that their own blue-eyed sons would live under the lash (042).","Slavery is not an indefinable mass of flesh. It is a particular, specific enslaved woman, whose mind is active as your own, whose range of feeling is as vast as your own; who loves her mother in her own complicated way, thinks her sister talks too loud, has a favorite cousin, a favorite season, who excels as dressmaking and knows, inside herself, that she is as intelligent and capable as anyone (069). | like any mass group tragic events (such as slavery or genocides), I think we often forget that acutal, once-living, those that supposed to have an normal and happy life individuals went though these events. We often just remember those who suffered as a group and forget that the individuals were just like us.","Think of all the love poured into him. Think of the tuition for Montessori and music lessons. Think of the gasoline expended, the treads worn carting him to football games, basketball tournaments, and Little League. Think of the time regulating sleepovers. That vessel which was her father, which brimmed with twenty-five years of love and was the investment of her grandparents and was to be her legacy (082) | I think Prince Jones's parents, like many others without the consideration of race, tried to raise their child with love, giving them, both materialized objects and experience, as much as other children had. All of that shattered is just difficult for the parents to take in, and I think this is why it's hard for someone to start over. I also like the metaphor of a vessel.","I did not understand it until I looked out on the street. That was where I saw white parents pushing double-wide strollers down gentrifying Harlem boulevards in T-shirts and jogging shorts...while their sons commanded entire sidewalks with their tricycles. The galaxy belonged to them, and as terror was communicated to our children, I saw mastery communicate to theirs (089) | I never saw the world through this lens, but I still think it's Americans race superiority confined to a daily observation, which I thought was cool that Coates described it this way. However, I dont completely agree with this POV: I feel like its a bit  because hes focusing on such a small, daily event. Nonetheless, I still understand what Coates is trying to communicate.","And the bodies were an aspiration, lucrative as Indian land, a veranda, a beautiful wife, or a summer home in the mountains, and the right to break the bodies was the mark of civilization (104) | This again brings me back to APUSH, where those with slaves were considered the highest rank among their small southern plantation community (because many actually did not own slaves).","The people who must believe they are white can never be your measuring stick. I would have you be a conscious citizen of this terrible and beautiful world (108).","The same hands that drew red lines around the life of Prince Jones drew red lines around the ghetto. (111) | This was an awesome and well-written projection from a smaller event to the larger event of how African Americans were forced into ghettos and their homes taken.","In America, I was part of an equation --- even if it wasnt a part I relished. I was the one the police stopped on 23 st. in the middle of a workday.. (124).","When it came to her son, Dr. Joness country did what it does best --- it forgot him. The forgetting is a habit, is yet another necessary component of the Dream. They have forgotten the scale of theft that enriched them in slavery; the terror that allowed them, for a century, to pilfer the vote; the segregationist policy that gave them their suburbs (141) | I very much agree with this quote and the idea that America likes to forget '' what they have done or what the people came before we had done. America often criticizes others for genocides but never takes into consideration of its own torture on minorities. What America is doing right now is never enough for compensation. Why is America still criticizing others?"],Thoughts:"At first, I rated this book a , but as I wrote the reflection, I thought it should be rated higher for what I gained from it. I saw through another lens regarding the topic of race and African-American (AA) discrimination. I was exposed to other ideas and just another view on the idea of slavery, which I thought was new. I noticed how the Coates relatively used parallel structure, which is very powerful and convincing, but I got a little tired of it. I also thought it was new that this whole book was written as a lesson and in a format similar to a letter for his son, which was an idea that was hard to keep in mind when I was reading. It was realistic that some sentences did not follow grammatical structures, and I could easily grasp his tone. There were also parts where the tone contrasted: sometimes hes peaceful and just wants to pass on lessons to his son, and sometimes hes angered but passionate. Something I did not like was that the thoughts were a little extreme, which I found similar to when I learned about Malcolm Xs central idea and way of action in APUSH. Although the book did talk about the authors thoughts on the events centered on AA history and equal rights that happened in history, it was not to the amount which I expected (I hope there could be more). And I hope that the author wouldve had a side note that discussed the AA that he brought up who was killed by police violence, specifically on who they were and how they were hurt by police violence. Otherwise, I think the book did a good job of covering a wide spectrum of different AA historical events including police violence news that we still could encounter today. The book also made me wonder a question: we still have most AA writers writing equal rights/AA discrimination today. Like most popular fiction, non-fiction, mystery, or even historical fiction excluding slavery are not written by AA authors. Does this reflect that AA and people calling for race equality actually made very minimal progress in the US regarding race issues?","Favorite Part":"My most memorable part was the part where Prince Jones was announced dead and killed by the police (He was dressed in his formal clothes, as though it was his senior prom, and frozen in the amber of his youth (077). It made me see another scenario of police violence based on skin color; however, unlike others, I was surprised to find that Prince Jones was actually intelligent and successful in his career and education (and his mom is an accomplished doctor). It countered manys perceptions that minorities cannot be at the top in their career or in school, but I still believe that those outstanding, accomplished minorities are still an unnoticeable percentage of the population."},:{Rating:"",Author:" ",Month:8,Language:"",Genre:["Fiction"],Quotes:["023"," 039| ","059)","  093)","QP(110)","141)"," (164)","183","195"],Thoughts:`   

